INSERT INTO `product` VALUES ('14', '1', '消息称Twitter IPO感恩节前进行 可能增加承销商', '消息人士透露，Twitter正在讨论增加IPO承销商，并考虑如何确定发行价。另外，Twitter IPO可能会在感恩节前进行。\r\n    通常，承销商可以获得整个IPO收益的7%作为报酬，但大规模发行可能会降低比例。例如，在Facebook高达160亿美元的IPO之后，承销商只获得了1.1%的收益报酬，原因就是这笔IPO规模巨大，而且承销商可以获得更高的声望。', './Public/upload/Casespic/201401/1390813156372315.jpg', '<p>\r\n	asasassasa</p>\r\n', '72', '0', '1388016000', '管理员', '', '', '');
INSERT INTO `product` VALUES ('15', '1', 'Gartner：今年全球应用程序下载量将突破1020亿', '根据权威市场研究机构Gartner的最新研究结果显示，智能手机渗透率的不断提高预计会让今年全球在线应用商店的程序下载量图突破1020亿次，其中来自苹果App Store和谷歌(微博)Google Play两大应用程序商店的下载量将占据了其中的90%。从而可能将今年全球应用程序市场营收提升至260亿美元。', './Public/upload/Product/201610/14759059844577.jpg', '', '12', '0', '1475905668', '管理员', '', '', '');
INSERT INTO `product` VALUES ('16', '1', '微软10月17日开放Win8.1下载 最低售价988元', '微软10月17日开放Win8.1下载 最低售价988元微软10月17日开放Win8.1下载 最低售价988元微软10月17日开放Win8.1下载 最低售价988元微软10月17日开放Win8.1下载 最低售价988元微软10月17日开放Win8.1下载 最低售价988元', './Public/upload/Casespic/201401/1390813027342133.jpg', '<p>\r\n	整个页面还是跟搜索框差不多简单，在摇号结果页，输入姓名或申请编码即可查询中签情况。还可以选择不同的月份。如果要进行短信通知的定制，需要先输入手机获取的验证码以避免信息骚扰。遗憾的是，这个便民功能目前只支持北京、广州2个城市。后续或将接入需要城市的数据。</p>\r\n<p>\r\n	此前百度已经开展多次类似的数据接入合作。315前夕百度与药监局达成战略合作，用户可在<img alt=\"\" src=\"/Public/fckuploads/201310images/201310120641116205.jpg\" style=\"width: 271px; height: 271px\" />百度搜索药品相关信息。百度还接入了气象局、火车票、航班等民生类信息。例如搜索&ldquo;广州天气&rdquo;可以看到实时的天气预报和空气质量信息。</p>\r\n<p>\r\n	百度的结果从简单的网页结果变为形式丰富的结果集，并且承载很多丰富的功能，正是百度&ldquo;中间页&rdquo;战略的推动。&ldquo;中间页&rdquo;是居于搜索引擎和传统行业之间的网页。传统搜索引擎的目标是满足用户查询信息的需求，新一代搜索引擎的返回的结果则是&ldquo;信息+服务&rdquo;，实现&rdquo;所搜即所得&rdquo;。</p>\r\n<p>\r\n	这反映出百度和Google这两个搜索巨头迥异的思路。Google的目标是让用户在搜索页停留得越短越好，理想是&ldquo;加速信息的流动&rdquo;；百度的目标则是给用户展现更直接、权威的搜索结果，理想是让用户更方便、快捷的获取信息。</p>\r\n<p>\r\n	不论是百度知道、贴吧和百科等自有内容页的强势，还是不断加强的中间页战略，均希望给用户提供一站式的信息+服务的需求满足。百度的理想是&ldquo;收集所有信息，满足用户的信息服务需求&rdquo;。它正在超出传统搜索的边界，承载&ldquo;智能搜索&rdquo;需求。</p>\r\n<p>\r\n	要实现这个目标并不容易<br />\r\n	传统行业的数据，尤其是政府部门的数据，并不会直接以网页形式开放。这些&ldquo;结构化数据&rdquo;，搜索引擎无法通过传统的爬虫这种技术手段获取。</p>\r\n<p>\r\n	百度推出&ldquo;框计算&rdquo;计划，其中的一部分内容便是以百度开放平台、百度网页应用承载的&ldquo;阿拉丁计划&rdquo;。第三方垂直网站可以将自己的结构化数据和应用主动接入百度，用户在搜索结果页即可查询和使用应用。由于在PC端拥有入口地位，百度对普通第三方网站具备号召力。</p>\r\n<p>\r\n	不过权威网站并不在此列。百度需要主动去获取数据。大数据时代，传统行业、权威部门拥有大量的数据，搜索引擎需要为获取这些数据付出一定的代价。</p>\r\n<p>\r\n	还有大量民生数据具有极强的本地特征。例如卫生部门、交通部门的数据。百度需要逐个攻破困难重重。目前其策略似乎是各个击破，能满足一部分用户先满足一部分。围绕用户无偿服务的态度还是值得鼓励的。更有效的模式或许是由中间代理角色来汇聚不同地区的数据，比如垂直网站。可以预见百度接下来将会与更多的第三方垂直网站合作。</p>\r\n<p>\r\n	搜索引擎离用户较近，并且已经构建用户习惯和形成品牌，可以成为许多网站的入口以及IO（输入输出）。搜索引擎与越来越多的传统垂直网站、权威部门的网站合作，提供与&ldquo;摇号&rdquo;类似的查询功能将成为常态，最大的获益者自然是有了更多选择的用户。我们乐见其成。</p>\r\n', '109', '0', '1381536000', '管理员', '', '', '');
